import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const[entries, setEntries] = useState([]);

  const fetchData = () => {
    fetch("http://localhost:3000/calendar")
    .then(response => response.json())
    .then(res => {
      if(res && res.data){
        console.log("writing to entries");
        this.setCourses(res.data);
      }
    });
  }

  const renderEntries = () => {
    if(this.state.entries.length <= 0){
      return <div>no entries available</div>
    } else {
      return this.state.entries.map((val, key) => {
        return <div key={key}>Day: {val.day}, Available: {val.available}</div>
      });
    }
  }

  return (
    <div className="App">

    </div>
  );
}

export default App;
